I'm comparing two objects using this code, to ignore properties starting with $:

```
function areElementEquals (leftElement, rightElement) {
	function customComparer (left, right, key) {
		if (_(key).startsWith('$'))
			return true;

		if (_.isObject(left))
			return _.isEqual(left, right, customComparer);

		return left === right;
	}

	return _.isEqual(leftElement, rightElement, customComparer);
}
```

The customComparer never receive the third argument (key) as the documentation says it should: https://lodash.com/docs#isEqual

