heres an easy one, i always hate typing this one out:

 - atLeast (cnt, value, array) returns bool
 - atMost (cnt, value, array)  returns bool

example:

    animals = [ 'cat','dog','bear','cat' ]
    if (_atLeast(2, 'cat', animals))
      feedcats()


replaces

    animals = ['cat','dog','bear','cat']
    cnt = 0;
    for (animal of animals){
      if (animal == 'cat'){
        cnt += 1
      }
    }
    if (cnt > 2){
         feedcats()
    }

